import Movie from './Movie';
import PersonalPage from './PersonalPage';
import './App.css';

function App() {
  return (
    <div className="App">
      <Movie
        name="Back to the future"
        director="Robert Zemeckis"
        year="1985"
        studio="Universal Picture"
        poster="./poster.jpg"
      />

      <PersonalPage
        name="Your Name"
        phone="123-456-7890"
        email="your.email@example.com"
        city="Your City"
        photo="url_to_your_photo.jpg"
      />
    </div>
  );
}

export default App;
